Construction Environmental Management and Site Waste Management 

No development shall commence in a Phase, including any works of demolition, until a Construction Environmental Management Plan (CEMP) and a Site Waste Management Plan (SWMP) for the relevant Phase have been submitted to and approved in writing by the Local Planning Authority.  These Plans shall incorporate details of:

a)	construction traffic management;
b)	the parking of vehicles of site operatives and visitors;
c)	loading and unloading of plant and materials;
d)	storage of plant and materials used in constructing the development;
e)	the erection and maintenance of security hoarding(s) including decorative displays and facilities for public viewing, where appropriate;
f)	wheel washing facilities;
g)	measures to control the emission of dust, dirt and emissions to air during construction; such measures to accord with the guidance provided in the document "The Control of Dust and Emissions during Construction and Demolition", Mayor of London, July 2014; including but not confined to, non road mobile machinery (NRMM) requirements;
h)	noise and vibration control;
i)	a scheme for recycling/disposing of waste resulting from demolition and construction works;
j)	the use of efficient construction materials;
k)	methods to minimise waste, to encourage re-use, recovery and recycling, and sourcing of materials; and
l)	a nominated Developer/Resident Liaison Representative with an address and contact telephone number to be circulated to those residents consulted on the application by the developer's representatives. This person will act as first point of contact for residents who have any problems or questions related to the ongoing development.

Demolition and construction work and associated activities, other than internal works not audible outside the site boundary, are only to be carried out between the hours of 08:00 and 18:00 Monday to Friday and 08:00 and 13:00 Saturday, with no work on Sundays or public holidays without the prior written permission of the Local Planning Authority.  Any works which are associated with the generation of ground borne vibration are only to be carried out between the hours of 08:00 and 18:00 Monday to Friday.

Demolition and construction work and associated activities are to be carried out in accordance with the recommendations contained within British Standard 5228:2009, "Code of practice for noise and vibration control on construction and open sites". Parts 1 and 2.

Once approved the Plans shall be adhered to throughout the construction period for the relevant Phase.

Reason:  The CEMP and SWMP are required prior to commencement of development in each Phase in order to reduce the environmental impact of the construction and the impact on the amenities of neighbouring residents, and in accordance with policy BP8 of the Borough Wide Development Policies Development Plan Document.

Hard Landscaping

No Phase of the development hereby permitted shall be occupied until full details of the hard landscaping for the relevant Phase have been submitted to and approved in writing by the Local Planning Authority.  The hard landscaping scheme shall include, but not be limited to, details of the following:

a)	surface materials;
b)	play spaces and any related play equipment;
c)	street furniture, including on-street cycle stands;
d)	boundary treatment, including to the riverside and roof terraces; and
e)	management and maintenance.

The hard landscaping scheme shall be implemented prior to occupation of the relevant Phase in accordance with the approved details and thereafter permanently maintained, to the satisfaction of the Local Planning Authority.

Reason:  In the interests of design quality, residential amenity, walking, accessibility and public safety, in accordance with policy CP3 of the Core Strategy and policy BP11 of the Borough Wide Development Policies Development Plan Document.
